const Bloglist = () => {
    return (
        <div className="blog-list">
            {blogs.map((blog_object) => (
                <div className="blog-preview" key={blog_object.id}> 
                    <h2>{blog_object.title}</h2>
                    <p> Written by: {blog_object.authour}</p>
                </div>
            ))}
        </div>
    );
}    

export default Bloglist
